/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "lifecycleHooks": {
        "onMount": "initialize",
        "onUnmount": "cleanup"
    },
    "actions": {
        "initialize": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "initializePage"
                },
                {
                    "action": "updateBaseSelection"
                }
            ]
        },
        "initializePage": {
            "actionType": "JSFunctionAsync",
            "method": "initializePage",
            "inputData": {
                "provider": "{{props.provider}}",
                "baseSelection": "{{props.baseSelection}}"
            },
            "outputData": {
                "stateContext": "stateContext",
                "propertyPolicyId": "propertyPolicyId"
            },
            "deps": "js/AwBaseSublocationService"
        },
        "handleCompleteEvent": {
            "actionType": "JSFunction",
            "method": "handleCompleteEvent",
            "inputData": {
                "provider": "{{parameters.eventData}}"
            },
            "deps": "js/AwBaseSublocationService"
        },
        "cleanup": {
            "actionType": "JSFunction",
            "method": "cleanupPage",
            "inputData": {
                "stateContext": "{{data.stateContext}}",
                "propertyPolicyId": "{{data.propertyPolicyId}}"
            },
            "deps": "js/AwBaseSublocationService"
        },
        "updateBaseSelection": {
            "actionType": "JSFunction",
            "method": "updateBaseSelection",
            "inputData": {
                "selection": "{{props.baseSelection}}",
                "parentSelectionData": "{{props.selectionData}}",
                "selectionQueryParamKey": "{{props.provider.selectionQueryParamKey}}"
            },
            "deps": "js/AwBaseSublocationService"
        }
    },
    "onEvent": [
        {
            "eventId": "complete",
            "action": "handleCompleteEvent",
            "inputArgs": {
                "eventData": "{{eventData}}"
            }
        }
    ],
    "props": {
        "provider": {
            "type": "object"
        },
        "base-selection": {
            "type": "object"
        },
        "selection-data": {
            "type": "object"
        }
    },
    "_viewModelId": "AwBaseSublocation2",
    "_uniqueViewModelId": "AwBaseSublocation2",
    "ctx": {}
};

/*
{props.children}

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
